const PortfolioDetail = ({query}) => {
  const { id } = query;
  return (
    <h1>I am Detail Page with ID: {id}</h1>
  )
}

PortfolioDetail.getInitialProps = ({query}) => {
  return {query};
}



export default PortfolioDetail;
